For use by `ToTokens` implementations.

```
# #[macro_use] extern crate quote;
# use quote::{Tokens, ToTokens};
# fn main() {
struct X;

impl ToTokens for X {
    fn to_tokens(&self, tokens: &mut Tokens) {
        tokens.append("a");
        tokens.append("b");
        tokens.append("c");
    }
}

let x = X;
let tokens = quote!(#x);
assert_eq!(tokens.as_str(), "a b c");
# }
```

